import useFetch from '../service/service';


function User(id) {
  const {user, loading, error} = useFetch(`http://localhost:3000/user/18`)

  if(loading) return <h1>LOADING ...</h1>
  if(error) console.log(error);

  return (
    <div className="App">
      <h1>
        {user?.data.id}
      </h1>
    </div>
  );
}

export default User;
